import styled from 'styled-components';

export const BackendHomeStyled = styled.div`
	position: absolute;
	top: 100px;
	width: 100vw;
	height: calc(100vh - 100px);
	display: grid;
	background-color: black;
	grid-template-columns: 1fr 7fr;
`;
